import "./HomePart1Style.css"
import { BrowserRouter as Router, Route, Link ,Routes, useNavigate} from "react-router-dom";  
export default function HomePart1(){

    return (
        <div id="homepart1">
            <div className="left">
                <div className="text1">We can test the robustness of AI model for you</div>
                <div className="text2">Our detection methods are more innovative, comprehensive, and intuitive</div>
                <div className="button"><Link to="/test">Test your model -></Link></div>
            </div>
            <div className="leftpic"></div>
            <div className="rightpic"></div>
            <div className="midlogo"></div>
            <div className="right">
            </div>
        </div>
    );
}
